import CampaingModel from '../../../models/campaing'
import { ContentContainer } from './styles'

interface Props {
  campaings?: CampaingModel[]
}

const CampaingsTab = ({ campaings }: Props) => {
  return (
    <ContentContainer>
      {campaings? (
        ''
      ) : (
        'Nenhuma campanha foi criada até o momento.'
      )}
    </ContentContainer>
  )
}

export default CampaingsTab
